import { UsersRepository } from "../infrastructure/repositories/UsersRepository";
import { UserItem } from "../models/presentation/UserItem";
import { Storage } from "../infrastructure/Storage";
import {
  InvlalidSessionTokenError,
  UnauthorizedError,
} from "../infrastructure/repositories";

// 入力用のクラス
export class FetchUsersInput {
  readonly sessionToken: string;

  constructor(sessionToken: string) {
    this.sessionToken = sessionToken;
  }
}

export class FetchUsersOutput {
  readonly users: UserItem[];

  constructor(users: UserItem[]) {
    this.users = users;
  }
}

export class FetchUsersUsecase {
  static fetch(usersRepository: UsersRepository, sessionToken: string) {
    throw new Error("Method not implemented.");
  }
  async fetch(input: FetchUsersInput): Promise<FetchUsersOutput> {
    const { sessionToken } = input;

    if (!sessionToken) {
      return Promise.reject(new InvlalidSessionTokenError());
    }

    try {
      const data = await new UsersRepository().fetch(sessionToken);
      const users = data.map((user: any) => new UserItem(user));
      return new FetchUsersOutput(users);
    } catch (e) {
      if (e instanceof UnauthorizedError) {
        Storage.clear();
      }
      throw e;
    }
  }
}
